import React, { useState } from 'react';

const Header = () => {
  const [isServicesOpen, setIsServicesOpen] = useState(false);
  const [isSolutionsOpen, setIsSolutionsOpen] = useState(false);

  return (
    <div>
      <header style={styles.header}>
        <h1 style={styles.title}>Logo</h1>
        <nav style={styles.nav}>
          <ul style={styles.navList}>
            {/* Services Dropdown */}
            <li 
              style={styles.navItem} 
              onMouseEnter={() => setIsServicesOpen(true)}
              onMouseLeave={() => setIsServicesOpen(false)}
            >
              <a href="/about" style={styles.navLink}>Services</a>
              {isServicesOpen && (
                <ul style={styles.dropdownMenu}>
                  <li style={styles.dropdownItem}><a href="/about/team" style={styles.navLink}>Datta annotation and enhancement</a></li>
                  <li style={styles.dropdownItem}><a href="/about/mission" style={styles.navLink}>Localization - transcription and translation</a></li>
                  <li style={styles.dropdownItem}><a href="/about/history" style={styles.navLink}>Data Validation</a></li>
                  <li style={styles.dropdownItem}><a href="/about/history" style={styles.navLink}>Custom data sourcing</a></li>
                  <li style={styles.dropdownItem}><a href="/about/history" style={styles.navLink}>Content moderation</a></li>
                </ul>
              )}
            </li>

            {/* Solutions Dropdown */}
            <li 
              style={styles.navItem} 
              onMouseEnter={() => setIsSolutionsOpen(true)}
              onMouseLeave={() => setIsSolutionsOpen(false)}
            >
              <a href="/solutions" style={styles.navLink}>Solutions</a>
              {isSolutionsOpen && (
                <ul style={styles.dropdownMenu}>
                  <li style={styles.dropdownItem}><a href="/solutions/ai" style={styles.navLink}>NLP</a></li>
                  <li style={styles.dropdownItem}><a href="/solutions/automation" style={styles.navLink}>Automation</a></li>
                  <li style={styles.dropdownItem}><a href="/solutions/analytics" style={styles.navLink}>Analytics</a></li>
                  <li style={styles.dropdownItem}><a href="/solutions/cloud" style={styles.navLink}>Cloud Solutions</a></li>
                </ul>
              )}
            </li>

            <li style={styles.navItem}><a href="/contact" style={styles.navLink}>Resources</a></li>
            <li style={styles.navItem}><a href="/contact" style={styles.navLink}>Pricing</a></li>
            <li style={styles.navItem}><button style={styles.button}>Contact Us</button></li>
          </ul>
        </nav>
      </header>
    </div>
  );
};

// Keep the same styles object as before
const styles = {
  header: {
    backgroundColor: '#043873',
    padding: '1rem',
    color: 'white',
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
  },
  title: {
    margin: '0',
  },
  nav: {
    display: 'flex',
  },
  navList: {
    listStyle: 'none',
    margin: '0',
    padding: '0',
    display: 'flex',
    alignItems: 'center'
  },
  navItem: {
    marginLeft: '2rem',
    position: 'relative',
  },
  navLink: {
    color: 'white',
    textDecoration: 'none',
  },
  dropdownMenu: {
    position: 'absolute',
    top: '100%',
    left: '0',
    backgroundColor: '#043873',
    listStyle: 'none',
    margin: '0',
    padding: '0.5rem 0',
    borderRadius: '4px',
    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.2)',
  },
  dropdownItem: {
    padding: '0.5rem 1rem',
    whiteSpace: 'nowrap'
  },
  button: {
    padding: '10px 20px',
    backgroundColor: '#007BFF',
    color: '#fff',
    border: 'none',
    borderRadius: '5px',
    cursor: 'pointer',
    fontSize: '16px',
  },
};

export default Header;
